import React, { useState } from 'react';

import { Link,useHistory } from 'react-router-dom';

import {Container} from 'semantic-ui-react';

import { Icon, Label, Menu, Table, Modal, Header, Button, Checkbox, Dropdown, Grid, Segment  } from 'semantic-ui-react';
export default function Addjob() {
     const [open, setOpen] = useState(false)
 return(
      <Modal style={{ "height": "35%", "width": "30%","position": "relative", "background-color": "rgb(0 0 0 / 62%)" }}
      centered={true}
      open={open}
      trigger={ <button class="circular ui icon button green" style={{"margin-left": "20px"}}> 
     
 <Icon inverted name='white plus'/>
</button>
      }
      onClose={() => setOpen(false)}
      onOpen={() => setOpen(true)}
    >
      <Header icon='plus' />
 <Modal.Content>
       
            
<span style={{"color":"grey","font-size":"20px"}}>  Add job</span>
      </Modal.Content>
      <Modal.Actions>
        <Button color='red' onClick={() => setOpen(false)}>
          <Icon name='remove'  /> Close
        </Button>
        
      </Modal.Actions>
    </Modal>   
 )
}
